			//Product Rating
			var star0 = $('.0star-rating');
			var star1 = $('.1star-rating');
			var star2 = $('.2star-rating');
			var star3 = $('.3star-rating');
			var star4 = $('.4star-rating');
			var star5 = $('.5star-rating');

